import axios from "axios";

const AddPlan = async ({ content }) => {
    const { address } = content; //제거기능이랑 마이플랜에서 버튼이동기능, 빌딩네임문제 수정해야함. 그 이후에 css.
    const memo = "테스트";
    const content_id = 1;
    console.log(memo, address);
    try {
        await axios.post('http://localhost:8000/api/add_plan', {
            list_address: address,
            memo: memo,
            content_id: content_id
        }, {
            headers: {
                'Content-Type': 'application/json',
            },
        });
        console.log('Plan added successfully');
    } catch (error) {
        console.error('Error adding plan:', error);
    }
}

const DeletePlan = async ( index ) => {
    try {
        await axios.delete('http://localhost:8000/api/delete_plan', {content_id: index}, {
            headers: {
                'Content-Type': 'application/json',
            },
        });
        alert("delete complete")
    } catch (error) {
        console.error('Error deleting plan:', error);
    }
}

export {AddPlan, DeletePlan};
